#include <string>
#include <iostream>
using std::string;

class Solution {
public:
    bool winnerOfGame(string colors) {
        return detect(colors, 'A')>detect(colors, 'B');
    }

    bool winnerOfGame2(string colors) {
        if(colors.size()<3) return false;
        int a=0, b=0;
        for(size_t i=0; i<colors.size()-2; ++i)
        {
            if (colors[i]=='A' && colors[i]==colors[i+1] && colors[i]==colors[i+2]) 
                ++a; 
            else if (colors[i]=='B' && colors[i]==colors[i+1] && colors[i]==colors[i+2]) 
                ++b;       
        }
        return a>b;
    }

private:

    // 检测连续3个相同的片段
    bool detectAndDelete(string& colors, const char& c)
    {
        if (colors.size()<=2)
            return false;
        for(size_t i=0; i<colors.size()-2; ++i)
        {
            if (colors[i]==c && colors[i]==colors[i+1] && colors[i]==colors[i+2]) {
                // std::cout<<"erase color["<<i+1<<"]="<<colors[i+1]<<std::endl;
                colors.erase(i+1, 1);
                // std::cout<<"colors: "<<colors<<std::endl;
                return true;
            }
        }
        return false;
    }
    int detect(string& colors, const char& c)
    {
        if (colors.size()<=2)
            return 0;
        int res=0;
        for(size_t i=0; i<colors.size()-2; ++i)
        {
            if (colors[i]==c && colors[i]==colors[i+1] && colors[i]==colors[i+2]) {
                ++res;            }
        }
        return res;
    }
};

int main(){

    string test = "AAAABBBB";
    string test1 = "";

    Solution s;
    std::cout<<s.winnerOfGame2(test1);
    return 0;
}